import React , { Component }from 'react'
import { theUrl } from 'selfConfig'
import { connect } from 'react-redux'
import { Table, Divider, Tag } from 'antd'

// For the Table of admin list 
const theColumn = [{
    title: 'ID',
    dataIndex: 'id',
    key: 'id',
  }, {
    title: 'Username',
    dataIndex: 'username',
    key: 'username',
  }, {
    title: 'Phone',
    dataIndex: 'phone',
    key: 'phone',
}, {
    title: 'Action',
    key: 'action',
    render: (text, record) => (
      <span>
        <a href="javascript:;">Invite {record.name}</a>
        <Divider type="vertical" />
        <a href="javascript:;">Delete</a>
      </span>
    ),
}]

class List extends Component {
    constructor(props) {
        super(props)
        this.getList = this.getList.bind(this)
        this.state = {
            url: theUrl + '/getAdminList',
            columns: theColumn,
        }
    }
    componentDidMount() {
        this.getList(this.props.dispatch, this.state.url)
    }   

    getList = (dispatch, getAdminList) => {

        fetch(getAdminList)
        .then(res => { return res.json() })
        .then(res => {
            dispatch({
                type: 'INIT_LIST',
                res
            })
            // Debugging
            // console.log(res)
        })
    }

    render() {
        return(
            <div>

                <Table 
                    dataSource={this.props.list}
                    columns={this.state.columns}
                />
                <h1>shit</h1>
            </div>
        )
    }
}


const mapStateToProps = state => ({
    list: state.list
})
export default connect(
    mapStateToProps
)(List);
